import React from 'react';
import ReturnCurrent from './Current';
import GridLoader from 'react-spinners/GridLoader';

// Current Main 
export default function CuRRent() {

  const [loading, setLoading] = React.useState(false);
  React.useEffect(() => {
    setLoading(true);

    setTimeout(() => {
      setLoading(false);
    }, 3600);

  }, []);

  return (
    <div>
      {
        loading ?
          <div className='App-loading'>
            <GridLoader
              size={15}
              color={'#00b8d4'}
              loading={loading}
            />
          </div>
          :
          <ReturnCurrent />
      };
    </div>
  );
};
